import logo from './logo.svg';
import './App.css';
import Contact from './Contact';
import { useState } from 'react';

function App() {

  const fruits = ['Apple', 'Banana', 'Orange', 'Mango'];

  const [nationData, setNationData] = useState([]);
  const [text, setText] = useState('');



function addTask(text) {

 }

  function fetchData() {

    fetch("https://datausa.io/api/data?drilldowns=Nation&measures=Population").
      then((response) => response.json())
      .then((data) => { setNationData(data.data) });
  }



  return (
    <div>

      <input type="text" value={text} onChange={e => setText(e.target.value)}  />
      <button type='button' onClick={() => addTask(text)}>Add List</button>
      {/* <p>You typed: {addList}</p> */}

      <ul>
      {fruits.map((task, index) => (
      <li key={index}>{task} </li>
      ))}
      </ul>


      <button type='button' onClick={fetchData}>click me</button>

      <div className='dataMain'>
      {nationData.map((data, index) => (
      <div className='dataList' key={index}>

           <p> <strong>Nation:</strong> ({data.Nation})</p>
           <p> <strong>Population:</strong> {data.Population}</p>
           <p> <strong>Year:</strong> {data.Year}</p>

          </div>

      ))}

</div>

      {/* <Contact /> */}

    </div>
  );
}

export default App;
